let tableArray;

export default function HomePage({onChange, newState}){

    console.log(newState[1] + "is the id")
    fetch(`http://127.0.0.1:5000/getUser/${newState[1]}`).then(function (response){

        if(response.ok) {
            response.json()
            .then(function(response) {
                console.log(response + "something happened");
            });
            tableArray = response.json()
        }
        else {
            throw Error('Something went wrong');
        }
    })



    return (
        <div className='App'>

            <div style={{display: "grid", gridTemplateColumns: "1fr 2fr 1fr"}}>
                <div></div>
                <div><h1>FAKYAK HOMEPAGE</h1></div>
                <h2>Welcome</h2>
                <div>
                <button onClick={onChange}>LOG OUT</button>
                </div>

            </div>


            <div>
                <div>
                <label>Post Content: </label>
                </div>
                <div>
                <textarea id="w3review" name="w3review" rows="4" cols="50"></textarea>
                </div>


                <button onClick={() => {
                    console.log("You clicked me!")
                }}>SUBMIT</button>
            </div>
                <br/>
                <br/>
                <br/>
                <br/>
                <div>
                    <button>Get Data</button>
                </div>

        </div>
    )
}
